-->Уход за папильоном-щенком включает в себя кормление, выгул, приучение к туалету, профилактику паразитов, гигиенические процедуры и уход за шерстью

-->Вопрос о кормлении малыша лучше сразу оговорить с его заводчиком. Зная особенности породной линии, проблемы с пищеварением или наличие аллергии у кого-то из предков щенка, он поможет вам сформировать оптимальное меню для питомца. Скорее всего, это будет мясоовощное питание с добавлением творога, злаков и морской рыбы либо, наиболее подходящий для папильона, готовый корм.

-->Важно не пытаться сразу кормить щенка чем-то новым. Даже очень полезным и вкусным! Помните, что для него это стресс и первую неделю лучше давать лишь те продукты, которые он получал у заводчика.

-->И щенки, и взрослые папильоны очень любят гулять. Даже если Вы ограничены во времени, две-три прогулки в день по 15-20 минут и три-четыре полуторачасовых выгула в неделю должны стать нормой для Вас. А еще, чем чаще вы будете выносить щенка на улицу, тем быстрее перестанете убирать за ним в квартире. Ходить в туалет вне дома естественно для папильнонов, но при желании они легко приучаются к лотку.

-->Не забывайте каждые три месяца давать щенку (и взрослой собаке) противоглистное, а в весенне-летний сезон обрабатывать питомца препаратами от блох и клещей.

-->Сразу приучите маленького папильона и к необходимым гигиеническим процедурам. А именно:
-Чистке ушей (1 раз в две недели, с помощью специальных средств)
-Осмотру и чистке зубов (по мере необходимости)
-Стрижке когтей (по мере отрастания)
-Удалению скопившейся слизи в уголках глаз (по мере необходимости, с помощью специальных лосьонов)

Пройдет совсем немного времени и уход за папильоном станет для Вас привычным и совсем не обременительным делом. А малыш превратится в настоящего красавца, бесконечно преданного и всегда готового следовать за Вами.
